    const handleSubmit = async (e) => {
        console.log("Handle submit");
    }

  return (
    <form onSubmit={handleSubmit}>
      <input
       type="text"
       value={title}
       onChange={(e) => setTitle(e.target.value)}
      />
      <input
       type="text"
       value={description}
      />
      <button type='submit'>Add item</button>
    </form>
  );
};

